import React, { useEffect, useState } from "react";
import api from "../api/axios";

export default function Dashboard() {
  const [agents, setAgents] = useState([]);
  const [leads, setLeads] = useState([]);
  const [loading, setLoading] = useState(true);
  const [deleting, setDeleting] = useState(null);
  const [message, setMessage] = useState("");

  const user = JSON.parse(localStorage.getItem("user") || "{}");

  useEffect(() => {
    const load = async () => {
      try {
        if (user.role === "admin") {
          const [a, l] = await Promise.all([
            api.get("/agents"),
            api.get("/leads"),
          ]);
          setAgents(a.data);
          setLeads(l.data);
        } else {
          const mine = await api.get("/leads/mine");
          setLeads(mine.data);
        }
      } catch (e) {
        console.error(e);
      } finally {
        setLoading(false);
      }
    };
    load();
  }, [user.role]);

  // Helper to get agent name
  const getAgentName = (agent) => {
    if (!agent) return "Unassigned";
    if (typeof agent === "object" && agent.name) return agent.name;
    const found = agents.find(
      (a) => a._id === agent || (agent._id && a._id === agent._id)
    );
    return found ? found.name : "Unassigned";
  };

  // Delete handler
  const handleDelete = async (leadId) => {
    if (!window.confirm("Are you sure you want to delete this lead?")) return;
    setDeleting(leadId);
    try {
      await api.delete(`/leads/${leadId}`);
      setLeads((prev) => prev.filter((l) => l._id !== leadId));
      setMessage("âœ… Lead deleted successfully!");
      setTimeout(() => setMessage(""), 3000);
    } catch (e) {
      setMessage("âŒ Failed to delete lead.");
      setTimeout(() => setMessage(""), 3000);
    } finally {
      setDeleting(null);
    }
  };

  if (loading) {
    return (
      <div style={styles.loaderWrapper}>
        <div style={styles.loader}></div>
        <p>Loading dashboard...</p>
      </div>
    );
  }

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>ðŸ‘‹ Welcome, {user.name || "User"}</h1>

      {message && <div style={styles.toast}>{message}</div>}

      {user.role === "admin" ? (
        <>
          <div style={styles.grid}>
            <div style={styles.card}>
              <h3 style={styles.cardTitle}>Total Agents</h3>
              <div style={styles.cardValue}>{agents.length}</div>
            </div>
            <div style={styles.card}>
              <h3 style={styles.cardTitle}>Total Leads</h3>
              <div style={styles.cardValue}>{leads.length}</div>
            </div>
          </div>

          {/* Admin Leads Table */}
          <div style={{ ...styles.tableWrapper, marginTop: 32 }}>
            <h3 style={styles.subtitle}>ðŸ“‹ All Leads</h3>
            <table style={styles.table}>
              <thead>
                <tr style={styles.tableHeadRow}>
                  <th style={styles.th}>First Name</th>
                  <th style={styles.th}>Phone</th>
                  <th style={styles.th}>Notes</th>
                  <th style={styles.th}>Agent</th>
                  <th style={styles.th}>Action</th>
                </tr>
              </thead>
              <tbody>
                {leads.length === 0 ? (
                  <tr>
                    <td colSpan="5" style={{ padding: 12, textAlign: "center" }}>
                      No leads found.
                    </td>
                  </tr>
                ) : (
                  leads.map((l) => (
                    <tr key={l._id} style={styles.tr}>
                      <td style={styles.td}>{l.firstName}</td>
                      <td style={styles.td}>{l.phone}</td>
                      <td style={styles.td}>{l.notes}</td>
                      <td style={styles.td}>{getAgentName(l.agent)}</td>
                      <td style={styles.td}>
                        <button
                          style={styles.deleteBtn}
                          onClick={() => handleDelete(l._id)}
                          disabled={deleting === l._id}
                        >
                          {deleting === l._id ? "Deleting..." : "Delete"}
                        </button>
                      </td>
                    </tr>
                  ))
                )}
              </tbody>
            </table>
          </div>
        </>
      ) : (
        <div style={styles.tableWrapper}>
          <h3 style={styles.subtitle}>ðŸ“‹ Your Assigned Leads</h3>
          <table style={styles.table}>
            <thead>
              <tr style={styles.tableHeadRow}>
                <th style={styles.th}>First Name</th>
                <th style={styles.th}>Phone</th>
                <th style={styles.th}>Notes</th>
              </tr>
            </thead>
            <tbody>
              {leads.length === 0 ? (
                <tr>
                  <td colSpan="3" style={{ padding: 12, textAlign: "center" }}>
                    No leads assigned.
                  </td>
                </tr>
              ) : (
                leads.map((l) => (
                  <tr key={l._id} style={styles.tr}>
                    <td style={styles.td}>{l.firstName}</td>
                    <td style={styles.td}>{l.phone}</td>
                    <td style={styles.td}>{l.notes}</td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

// âœ… Styles
