    borderCollapse: "collapse",
  },
  th: {
    textAlign: "left",
    padding: "12px",
    background: "#2563eb",
    color: "white",
    fontWeight: "600",
  },
  tr: {
    borderTop: "1px solid #e5e7eb",
  },
  td: {
    padding: "12px",
    fontSize: "15px",
    color: "#1e293b",
  },
  tableHeadRow: {
    borderBottom: "2px solid #1e3a8a",
  },
  loaderWrapper: {
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    height: "100vh",
    fontSize: "18px",
  },
  loader: {
    width: "40px",
    height: "40px",
    border: "4px solid #ddd",
    borderTop: "4px solid #2563eb",
    borderRadius: "50%",
    animation: "spin 1s linear infinite",
    marginBottom: "10px",
  },
  deleteBtn: {
    background: "#ef4444",
    color: "#fff",
    border: "none",
    borderRadius: "6px",
    padding: "6px 16px",
    cursor: "pointer",
    fontWeight: "bold",
    transition: "background 0.2s",
  },
  toast: {
    marginBottom: "16px",
    padding: "10px 16px",
    borderRadius: "8px",
    background: "#f1f5f9",
    border: "1px solid #ccc",
    color: "#111",
    fontSize: "14px",
    maxWidth: "400px",
  },
};
